//import logo from './logo.svg';
import './App.css';
export default function Bio() {
  return (
      <>
        <div className="intro">
          <h1>Welcome to my website!</h1>
        </div>
        <p className="summary">
          You can find my thoughts here.
          <br/><br/>
          And <b><i>pictures</i></b> of scientists!
        </p>
      </>
  );
}
